import { Button } from "@mui/material";
import React from "react";
import DropBoxCont from "./DropBox";
import Imdb from "./Imdb";
import { getMovies } from "./FireBase";

function App() {
  return (
    <>
      <DropBoxCont />
      <Imdb />
      <Button
        variant="standard"
        onClick={getMovies}
        sx={{ marginLeft: "100px" }}
      >
        Add Entry to DataBase
      </Button>
    </>
  );
}

export default App;
